import Footer from "./foooter";
import F_section from "../SecondProject/S_section";
import F_detail from "../SecondProject/S_detail";

function Project_info() {
  return (
    <div>
      <F_section />
      <F_detail />
      <Footer />
    </div>
  );
}

export default Project_info;
